import imagePA from "../assets/images/PA.png";
const Nav = () => {
  return (
    <div className="col-span-12">
      <div>
        <img src={imagePA} alt="PA" />
      </div>
      <div></div>
      <div>
        <div>Invitation</div>
        <div>Gallery</div>
        <div>Wishes</div>
      </div>
    </div>
  );
};
export default Nav;
